import React, { Suspense, Fragment, useEffect } from "react";
import { renderRoutes } from "react-router-config";
import PropTypes from "prop-types";
// import TopBar from "./Components/TopBar";
import TopBar from "../Components/CommonTopBar";
import Footer from "./Components/Footer";
import Loader from "../../Components/Loader";
import { getToken } from "../../utils/token";
import { getDeliveryRangeData } from "../../utils/commonFunction";

const Guest = (props) => {
  const {
    route,
    openLocation,
    resetUserProfile,
    getProductList,
    showToastMessage,
    resetToastMessage,
    showLogin,
    clearCartData,
    openLogin,
    closeLogin,
    openSignup,
    userProfile,
    userLocationName,
    cartCount,
    addToCart,
    logoutUser,
    getDeliveryRange,
    openFinetuneLocation,
    closeFinetuneLocation,
    productList,
    searchProductList,
    getSearchProductList,
    history,
    resetSearchProductList
  } = props;
  let displayQty = 0;
  addToCart &&
    addToCart.products.map((product) => {
      displayQty = Number(displayQty) + Number(product.quantity);
      return displayQty;
    });
    const onSucess = (payload) => {
      console.log("===>",payload && payload.data.data.length);
      payload && payload.data.data.length > 0 && showToastMessage({
        type: "success",
        message: "Some Item(s) are already in cart.",
      });
      resetToastMessage();
    };
    const onFail = (payload) => {
      showToastMessage({
        type: "error",
        message: payload.response && payload.response.data.message,
      });
      resetToastMessage();
    };
  useEffect(() => {
    const param = {
      order: "created_at",
    };
    if (getToken() && userProfile === null && !showLogin) {
      props.getUserProfile();
      props.getUserCartDetails({},onSucess,onFail);
    }
    /**
     * @param categoryId
     * @param search
     * @param store_id
     * @param sub_category_id
     * @param order
     */
    getProductList(param);
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [userProfile, showLogin]);

  useEffect(() => {
    localStorage.getItem("geo_latitude") &&
      localStorage.getItem("geo_longitude") &&
      getDeliveryRangeData(getDeliveryRange);
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);
  console.log(productList,"propsInfootr")
  return (
    <Fragment>
      <TopBar
      openLocation={openLocation}
        openFinetuneLocation={openFinetuneLocation}
        closeFinetuneLocation={closeFinetuneLocation}
        cartCount={displayQty}
        logoutUser={logoutUser}
        userLocationName={userLocationName}
        userProfile={userProfile}
        showToastMessage={showToastMessage}
        resetToastMessage={resetToastMessage}
        showLogin={showLogin}
        openLogin={openLogin}
        closeLogin={closeLogin}
        openSignup={openSignup}
        resetUserProfile={resetUserProfile}
        clearCartData={clearCartData}
        searchProductList={searchProductList}
        getSearchProductList={getSearchProductList}
        history={history}
        resetSearchProductList={resetSearchProductList}
      />
      <Suspense fallback={<Loader show={true} />}>
        {renderRoutes(route.routes)}
      </Suspense>
      <Footer addToCart={addToCart} productList={productList} />
    </Fragment>
  );
};

Guest.propTypes = {
  route: PropTypes.object,
};

export default Guest;
